import React from "react";
import './listTodo.scss'
import AddTodo from "./addTodo";

class ListTodo extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            ListTodos: [
                { id: 'todo1', title: 'doing homework' },
                { id: 'todo2', title: 'video calls' },
                { id: 'todo3', title: 'fixs bugs' },
            ]
        };
        AddTodo = (todo) => {
            this.setState({
                ListTodo: [...this.state.ListTodo, todo]
            })
        }
    }
    render() {
        let ListTodos = this.state.ListTodos;// = let{listTodo} =this.state.ListTodo
        return (
            <div className="Container">
                <AddTodo AddTodo={this.AddTodo} />
                <div className="content-list-todo">
                    {ListTodos && ListTodos.length > 0 && ListTodos.map((ListTodo, index) => {
                        return (
                            <div className="todo-list" key={ListTodo.id}>
                                <span>{index + 1}-{ListTodo.title}</span>
                                <button className="edit">edit</button>
                                <button className="delete">delete</button>

                            </div>
                        )
                    })}

                </div>
            </div>
        )
    }
}
export default ListTodo
